import React, { useEffect } from 'react';
import { Card, Table, Tag, Statistic, Row, Col, Alert, Spin, Space } from 'antd';
import { LoadingOutlined } from '@ant-design/icons';
import StatusIndicator from '@/components/StatusIndicator';
import { useAppStore } from '@/store';

const SLODashboard: React.FC = () => {
  const { sloStatus, loadingSLO, errorSLO, fetchSLOStatus, useMockData } = useAppStore();

  useEffect(() => {
    fetchSLOStatus();
  }, [fetchSLOStatus]);

  const getStatusTag = (status: string) => {
    switch (status) {
      case 'healthy':
        return <Tag color="success"></Tag>;
      case 'warning':
        return <Tag color="warning"></Tag>;
      case 'critical':
        return <Tag color="error"></Tag>;
      default:
        return <Tag></Tag>;
    }
  };

  const columns = [
    {
      title: '',
      dataIndex: 'serviceName',
      key: 'serviceName',
      render: (text: string) => <strong>{text}</strong>,
    },
    {
      title: '',
      dataIndex: 'status',
      key: 'status',
      render: (status: string) => (
        <Space>
          <StatusIndicator status={status as any} showText={true} />
          {getStatusTag(status)}
        </Space>
      ),
    },
    {
      title: ' (%)',
      dataIndex: 'uptime',
      key: 'uptime',
      render: (value: number) => `${value.toFixed(2)}%`,
      sorter: (a: any, b: any) => a.uptime - b.uptime,
    },
    {
      title: ' (ms)',
      dataIndex: 'responseTime',
      key: 'responseTime',
      render: (value: number) => value,
      sorter: (a: any, b: any) => a.responseTime - b.responseTime,
    },
    {
      title: ' (%)',
      dataIndex: 'errorRate',
      key: 'errorRate',
      render: (value: number) => `${value.toFixed(2)}%`,
      sorter: (a: any, b: any) => a.errorRate - b.errorRate,
    },
  ];

  const renderSummaryStats = () => {
    if (!sloStatus || sloStatus.length === 0) {
      return null;
    }

    const totalServices = sloStatus.length;
    const healthyServices = sloStatus.filter(s => s.status === 'healthy').length;
    const warningServices = sloStatus.filter(s => s.status === 'warning').length;
    const criticalServices = sloStatus.filter(s => s.status === 'critical').length;

    const avgUptime = sloStatus.reduce((sum, s) => sum + s.uptime, 0) / totalServices;
    const avgResponseTime = sloStatus.reduce((sum, s) => sum + s.responseTime, 0) / totalServices;
    const avgErrorRate = sloStatus.reduce((sum, s) => sum + s.errorRate, 0) / totalServices;

    return (
      <Row gutter={[16, 16]} style={{ marginBottom: 16 }}>
        <Col xs={24} sm={12} md={6}>
          <Card>
            <Statistic title="" value={totalServices} />
          </Card>
        </Col>
        <Col xs={24} sm={12} md={6}>
          <Card>
            <Statistic title="" value={healthyServices} valueStyle={{ color: '#52c41a' }} />
          </Card>
        </Col>
        <Col xs={24} sm={12} md={6}>
          <Card>
            <Statistic title="" value={warningServices} valueStyle={{ color: '#faad14' }} />
          </Card>
        </Col>
        <Col xs={24} sm={12} md={6}>
          <Card>
            <Statistic
              title=""
              value={criticalServices}
              valueStyle={{ color: '#ff4d4f' }}
            />
          </Card>
        </Col>
        <Col xs={24} sm={12} md={6}>
          <Card>
            <Statistic title="" value={avgUptime.toFixed(2)} suffix="%" />
          </Card>
        </Col>
        <Col xs={24} sm={12} md={6}>
          <Card>
            <Statistic title="" value={Math.round(avgResponseTime)} suffix="ms" />
          </Card>
        </Col>
        <Col xs={24} sm={12} md={6}>
          <Card>
            <Statistic title="" value={avgErrorRate.toFixed(2)} suffix="%" />
          </Card>
        </Col>
      </Row>
    );
  };

  return (
    <div>
      <h2>SLO</h2>

      {useMockData && <Alert message="Mock" type="info" style={{ marginBottom: 16 }} />}

      {loadingSLO ? (
        <div style={{ textAlign: 'center', padding: '40px' }}>
          <Spin indicator={<LoadingOutlined spin />} />
          <p>SLO...</p>
        </div>
      ) : errorSLO ? (
        <Alert
          message="SLO"
          description={errorSLO}
          type="error"
          showIcon
          style={{ marginBottom: 16 }}
        />
      ) : (
        <>
          {renderSummaryStats()}
          <Card title="SLO">
            {sloStatus?.length ? (
              <Table
                dataSource={sloStatus}
                columns={columns}
                rowKey="serviceName"
                pagination={{
                  pageSize: 10,
                  showSizeChanger: true,
                  pageSizeOptions: ['10', '20', '50'],
                }}
              />
            ) : (
              <div style={{ textAlign: 'center', padding: '20px' }}>SLO</div>
            )}
          </Card>
        </>
      )}
    </div>
  );
};

export default SLODashboard;

